import React, { Component } from 'react';
import { Card } from 'antd';


class AllTopic extends React.Component{

    render() {
        return (
            <div>
                <Card
                    title="Card title"
                    extra={<a href="#">More</a>}
                    style={{ width: 300 }}
                >
                    <p>Card content</p>
                    <p>Card content</p>
                    <p>Card content</p>
                </Card>
            </div>
        );
    }
}

export default AllTopic;
